import React from 'react'
import styled from 'styled-components';

const Container = styled.div`
  padding: 5px 5px;
  background-color: blue;
`;

const Wrapper = styled.div`
  background-color: red;
`;


const Navbar = () => {
  return (
    <Container>
      <Wrapper>
        Navbar
      </Wrapper>
    </Container>
  )
}

export default Navbar
